staticBinding.value:
Content-Type: multipart/form-data; boundary=${boundary}
Accept: application/json
X-Auth-Token: ${Token}

scriptlet.script:
try {
	var p = {};
	p['subscriptionName'] = subscriptionName;
	p['endDate'] = endDate;
	p['action'] = "MODIFY_SUBSCRIPTION";
	p['fields'] = {};	

	var body = "".concat("--",boundary,"\n","Content-Disposition: form-data; name=\"requestForm\"","\n","Content-Type: text/json","\n\n",JSON.stringify(p),"\n\n","--",boundary,"--");
	scriptletContext.put("body",body);
	scriptletResponse="success";
}
catch(Error) {
	scriptletContext.put("FailureMessage",Error);
	scriptletResponse="failure";
}
